var frames = {"p1": 0, "p2": 0};

$("table.frame-data tbody tr").each(function() {
	var tr = $(this);

	var p1 = +tr.find("td:eq(1)").text();
	var p2 = +tr.find("td:eq(3)").text();

	(p1 > p2) ?	frames.p1++ : frames.p2++;

	tr.find("td:eq(2)").append("<br />" + frames.p1 + ":" + frames.p2);
});

$("#label-timer").each(function() {

	var second = 1000;
	var counter = 15;
	var elem = $(this).attr("id","my-timer").text(counter);

	setTimeout(function(){
	   window.location.reload();
	}, counter * second);

	setInterval(function() {
	    counter--;
	    elem.text(counter);
	}, second);
})

var players = {};

$("#iface-content table tbody tr").each(function() {
	var player = $(this).find("td:eq(1) a").text();
	players[player]  = ~~players[player] + 1;
}).each(function() {
	var a = $(this).find("td:eq(1) a");
	a.append(' (' + players[a.text()] + ')');
})

var CONST_FEET = 30.48;
var CONST_INCH = 2.54;
var CONST_WEIGHT = 0.45359237;

var cell = $(".player-bio .general-info li:eq(1)");

var data = cell.text().split(", ");

var height = data[0].trim().split(" ");
var feet = parseInt(height[0], 10);
var inch = parseInt(height[1], 10);
var cm = parseInt(feet * CONST_FEET + inch * CONST_INCH, 10);

var weight = parseInt(data[1].trim(), 10);
var kg = parseInt(weight * CONST_WEIGHT, 10);

cell.attr("title", cell.text());
cell.text(cm + " cm, " + kg + " kg");
